package day4;

public class WhileLoopDemo2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.println("Start");
		
		int number =1;
		while(number<10)
		{
			System.out.println("Number " + number);
			number++;
		}
      System.out.println("End");
	}

}
